import React from 'react'
import {Col, Row} from 'antd'
import {Title} from '../../../UIComponents/Typography/Title'

const actions = [
    {
        itemName: 'about_me',
        itemDescription: 'passport_number_birth_living_place'
    },
    {
        itemName: 'records',
        itemDescription: ""
    }
]

export const AccountActionsBlock = () => {
    return (
        <Row gutter={[0, 12]}>
            <Col>
                <Row>
                    <Col>
                        <Title></Title>
                    </Col>
                </Row>
            </Col>
        </Row>
    )
}
